class Interval{constructor(a,b){this.duration=a,this.effort=b,this.start=0}get end(){return this.start+this.duration}seconds_to_file_format(a){return(a-(a%=60))/60+(9<a?".":".0")+Math.round(1.666667*a)}toString(){return`${this.seconds_to_file_format(this.start)} ${this.effort}\n${this.seconds_to_file_format(this.end)} ${this.effort}\n`}}export default Interval;